/* eslint-disable jsx-a11y/anchor-is-valid */
import axios from "axios";
import { useState,useEffect } from "react";

function FunctionB() {
	const [userInp,setUserInp]=useState('');
	const [apiData,setApiData]=useState([])
	const url='https://jsonplaceholder.typicode.com/todos/'

	useEffect(()=>{
		filterList()
		fetchApi()
	},[userInp])

	async function fetchApi(){
		const response=await axios.get(url)
		setApiData(response.data)
	}
	
	const filterList=()=>{
		const ol=document.getElementById("myOl")
		const upperInp=userInp.toUpperCase()
		const li=ol.getElementsByTagName("li")
		
		for(let i=0;i<li.length;i++){
			const liEle=li[i].getElementsByTagName("a")[0]
			const upper=liEle.innerText.toUpperCase()
			if(upper.indexOf(upperInp)>-1){
				li[i].style.display="block"
			}
			else
				li[i].style.display="none"
		}
	}

	return (
		<div className="container mt-5">
			<div className="col-5">
				<div>
					{
						apiData.map((ele,index)=>{return <h4 key={index}>{ele.title}</h4>})
					}
				</div>
				<div className="form-floating">
					<input 
						name="uName"
						id="uName"
						className=" form-control"
						type="text"
						value={userInp}
						placeholder="Enter your username"
						onChange={(e) =>setUserInp(e.target.value)}
					/>
					<label for="uName">Enter your username</label>
				</div>
				<ol className="mt-3" id="myOl">
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Rohit sharma</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Shubman Gill</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Virat Kohli</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Shreyas Iyer</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Ishan Kishan</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Kl Rahul</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Ravindra Jadeja</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Hardik Pandya</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Axar Patel</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Kuldeep Yadav</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Jasprit Bumrah</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Mohmmad Shami</a></li>
					<li className="my-2 border py-2 ps-3 bg-light"><a href="" className="text-dark">Mohmmad Siraj</a></li>
				</ol>
			</div>
		</div>
	)
}

export default FunctionB
